window.bookSummaryJSON = "<p><b>Betrayed. Murdered. Reborn. One last chance, to make it right. </b>Theo's adventure ended with his mentor's hands around his neck. The betrayal cost him his friends, allies and everything he had built... but not his life. Though broken and powerless, Theo has one last chance to enter the Nine Worlds, wielding the knowledge and expertise of his first life. This time, he needs more than just power, he needs to unravel the deception that killed him once... and is coming for him again.<br> <br> Theo gained immense power in the Chasm of Lamentations, but he gained new problems as well. Nauda's soulhome is a wreck and she has no choice but to begin the grueling rebuilding process. Fiyu awaits her relative, but his return may not be a happy one. War is stirring across Fithe, and forces may be challenging all three of them before they're ready...</p>"; 
